for urls in url_batches:
    batch_begin = time.time()
    with futures.ThreadPoolExecutor(max_workers=max(MAX_WORKERS, len(urls))) as executor:  # 实例化线程池
        res = executor.map(download, urls)

        # 跟内置的map很像，对序列进行相同操作，注意是异步、非阻塞的！
